    plt.figure(figsize=(12, 6))
    for idx,key in enumerate(latency_data.keys()):
        plt.subplot(int(f'{2}{4}{idx + 1}'))
        if key in ['TPC-1300']:
            # interval = 30
            interval = 20
        elif key in ['TPC-1600']:
            interval = 10
        elif key in ['TPC-2600']:
            # interval = 30
            interval = 25
            # plt.ylim(500,4600)
        else:
            interval = 20
        # plt.subplot(int(f'{4}{2}{idx+1}'))
        a=latency_data[key][0]
        b=latency_data[key][1]
        a=accumulate_val(a,interval)
        b=accumulate_val(b,interval)
        x=[(time+1)*interval for time in range(len(b))]
        l1,=plt.plot(x,a,'-.')
        l2,=plt.plot(x,b,'--.')

        plt.legend(handles=[l1, l2], labels=['pid', 'ppo'], loc=1,frameon=False)
        plt.ylim(min(a+b),max(a+b))
        plt.ticklabel_format(style='sci', scilimits=(0, 0), axis='y')
        if idx == 0 or idx == 4:
            plt.ylabel('Latency(s)',loc='center')
        if idx==0:
            plt.xlabel('Time',loc='center')
        plt.title(f'{key}', fontdict={'fontsize': 10})
